  const { addEmployees } = useContext(EmployeesContext);
  const { resetDatabase} = useContext(EmployeesContext);

const handleClick = async (e) => {
  e.preventDefault();
    var i = 0;

    while (i<1) {
      await randomUserGenerator()
      await i++;}
};

const randomUserGenerator = async () => {
  await fetch('https://randomuser.me/api/?results=10')
  .then((response) => {
      return response.json()
  }).then((data) => {
      console.log(data)
      data.results.map(employee => {
      const firstName = employee.name.first;
      const lastName = employee.name.last;
      const email = employee.email;
      const streetNumber = employee.location.street.number;
      const streetName = employee.location.street.name;
      const city = employee.location.city;
      const state = employee.location.state;
      const country = employee.location.country;
      const postalCode = employee.location.postcode;
      const dateOfBirth = employee.dob.date;
      const phoneNumber = employee.phone;
      const cellNumber = employee.cell;
      const pictureLarge = employee.picture.large;
      const pictureThumbnail = employee.picture.thumbnail;      

      const finishCreatingData = async () => {
        try {
          const response = await EmployeeFinder.post('/', {
        first_name: firstName,
        last_name: lastName,
        email: email,
        street_number: streetNumber,
        street_name: streetName, 
        city, 
        state, 
        country, 
        postal_code: postalCode,
        date_of_birth: dateOfBirth,
        phone_number: phoneNumber,
        cell_number: cellNumber,
        picture_large: pictureLarge,
        picture_thumbnail: pictureThumbnail

      }
      );
      console.log(response);
      addEmployees(response.data.data.employee);
        } catch (error) {
            console.log(error);
        }

    }
    finishCreatingData();
  }
    );
  })
  }

  const handleDelete = async (e, id) => {
    e.stopPropagation();
    try {
        const response = await EmployeeFinder.delete('/delete/');
        console.log(response);
        resetDatabase();

    } catch (error) {
        console.log(error);
    }
};

  return (
    <div className="mb-4">
      <form action="">
        <div className="form-row">
            <button onClick={handleClick} type="button" id="fetch" className="btn btn-primary">Fetch Employees</button>
            <div className="col-md-10">
              <button onClick={handleDelete} type="button" className="btn btn-primary">Reset Database</button>
            </div>
          </div>

        </form>
      </div>
    );
};

export default FetchEmployees;
